sources.styles/components/_form.scss:
.form {
  border-radius: 4px;
  &__label {
    margin-bottom: 4px;
    &--block {
      display: block;
    }
  }
  &__input {
    width: 100%;
    padding: 4px;
    box-sizing: border-box;
  }
  &__fieldset,
  &__field {
    margin-bottom: 8px;
  }
  &__option-fieldset {
    display: none;

    &--active {
      display: block;
    }
  }
  &__tabs {
    display: flex;
  }
  &__tab {
    background-color: $white;
    opacity: 0.6;
    flex: 1;
    text-align: center;
    padding: 16px 0;
    border-bottom: 1px solid $black;
    transition: all 300ms ease;
    border-top-left-radius: 4px;
    border-top-right-radius: 4px;
    border-left: 1px solid $white;
    border-top: 1px solid $white;
    border-right: 1px solid $white;
    &:hover {
      opacity: 1;
      cursor: pointer;
    }
    &--active {
      border-left-color: $black;
      border-top-color: $black;
      border-right-color: $black;
      border-bottom-color: $white;
      opacity: 1;
    }
  }
  &__main {
    background-color: $white;
    padding: 16px;
    border-left: 1px solid $black;
    border-right: 1px solid $black;
    border-bottom: 1px solid $black;
    border-bottom-left-radius: 4px;
    border-bottom-right-radius: 4px;
  }
}
.error-message {
  color: red;
  display: block;
}
.form-msg {
  padding: 32px;
  background: $white;
  font-size: 32px;
  text-align: center;
  &--success {
    color: $black;
  }
  &--error {
    color: red;
  }
}
.loader {
  border: 16px solid $blue;
  border-radius: 50%;
  border-top: 16px solid $white;
  width: 120px;
  height: 120px;
  animation: spin 2s linear infinite;
  position: fixed;
  top: calc(50% - 60px);
  left: calc(50% - 60px);
  transform: translate(-50%, -50%);
}
.js-loader {
  display: none;
  &--active {
    display: block;
  }
}
@keyframes spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

